const AddNote = (props) => {
  return (
    <ul>
    <li>
      <a href="#">
        <input
          placeholder="Note title"
          type="text"
          className="form-control"
          name="item"
          value={props.item}
          onChange={props.handleInputChange}
        />{" "}
        <textarea
          placeholder="item"
          type="text"
          className="form-control"
          name="han"
          value={props.han}
          onChange={props.handleInputChange}
        />
        <button className="btn btn-success mt-2" onClick={props.addinvoice}>
          {" "}
          Add
        </button>
      </a>
    </li>
    </ul>
  );
};

export default AddNote;
